import React, { version,useEffect, useState } from 'react';
import {FlatList,TouchableOpacity,StyleSheet,Image, Text, View, TextInput, TextComponent, ScrollView } from 'react-native';
import { Ionicons } from '@expo/vector-icons';

export default function ListDetail({navigation,url}) {
    const { data, otherParam } = url.params;
    return (
        <View>
          <Text>{data}</Text>
        </View>
  );
}

const styles = StyleSheet.create({
    container: {
      alignItems: 'center',
    },
    item:{
      backgroundColor: '#fff',
      padding:10,
      margin:5,
      width:'100%'
    }
  });
